import './Quote.css';
import Media from 'react-media';

// Register Quote Component 
export default function REturnQuOteRegister() {
 return (
  <div className='wrp-quote-regiter'>
   <h1>Official color tool</h1>
   <p>
    can help you create a color palette for your UI, as well
    as measure the accessibility level of any color combination.
   </p>
  </div>
 );
};

export const ScreenLarge = () => (
 <div className='wrp-quote-regiter'>
  <h1>Official color tool</h1>
  <p>
   can help you create a color palette for your UI, as well
   as measure the accessibility level of any color combination.
   </p>
 </div>
);
export const ScreenSmall = () => (
 <div className='wrp-quote-regiter-sm'>
  <h1>Official color tool</h1>
  <p>
   can help you create a color palette for your UI, as well
   as measure the accessibility level of any color combination.
   </p>
 </div>
);
